INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(7, 1, 'Chờ Em Đến Ngày Mai', '\"Chờ Em Đến Ngày Mai\" là một câu chuyện tình cảm đầy xúc động và lãng mạn của đạo diễn Lê Hoàng, phát hành vào năm 2013. Bộ phim kể về cuộc sống của An và Hà, hai con người có số phận gắn kết với nhau qua những tình huống không ngờ.\r\n\r\nAn, một cô gái trẻ sôi nổi, luôn giữ vững niềm tin vào tình yêu và cuộc sống. Trong khi đó, Hà lại là một chàng trai chín chắn, sống quyết đoán và tự tin. Sự gặp gỡ của họ là một sự tình cờ, nhưng mỗi khoảnh khắc họ bên nhau lại là cơ hội để họ hiểu rõ hơn về lòng tin và tình yêu.\r\n\r\nBối cảnh của bộ phim là thành phố Hà Nội lãng mạn, nơi mà câu chuyện tình yêu của An và Hà được thể hiện qua những cảnh quay đẹp mắt và lời thoại sâu sắc. \"Chờ Em Đến Ngày Mai\" không chỉ là một bộ phim giải trí mà còn là một câu chuyện đầy ý nghĩa về tình yêu và hy vọng, khiến khán giả cảm thấy nhẹ nhàng và ấm áp sau khi xem xong.', '2024-04-14 10:26:24', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(8, 1, 'Em Chưa 18', '\"Em Chưa 18\" là một bộ phim tình cảm học đường của đạo diễn Lê Thanh Sơn, ra mắt vào năm 2017, với sự tham gia của dàn diễn viên trẻ trung và tài năng như Kaity Nguyễn, Kinh Quốc, Jun Phạm, và Ngô Kiến Huy.\r\n\r\nCâu chuyện xoay quanh cuộc sống của Lâm, một cô gái trẻ năng động và hồn nhiên, nhưng lại phải đối mặt với những khó khăn và áp lực từ gia đình và xã hội. Trong quá trình trưởng thành, Lâm gặp gỡ và phát triển tình bạn đặc biệt với Hoàng, một chàng trai tốt bụng và thông minh.\r\n\r\n\"Em Chưa 18\" không chỉ là câu chuyện về tình bạn và tình yêu tuổi teen, mà còn là hành trình tìm kiếm bản thân và xác định ước mơ trong cuộc sống. Bằng cách kể chuyện gần gũi và chân thực, bộ phim đã chạm đến lòng khán giả, thể hiện sự trưởng thành và lý trí của những người trẻ tuổi. Đồng thời, \"Em Chưa 18\" cũng là một thông điệp về tình bạn, sự đồng cảm và hy vọng trong mọi hoàn cảnh.', '2024-04-14 10:30:18', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(9, 1, 'Cô Gái Đến Từ Hôm Qua', '\"Cô Gái Đến Từ Hôm Qua\" là một bộ phim tình cảm viễn tưởng của đạo diễn Phan Gia Nhật Linh, ra mắt vào năm 2017, mang đến một câu chuyện mới lạ và đầy ấn tượng về tình yêu và thời gian.\r\n\r\nCâu chuyện bắt đầu khi Linh, một cô gái xinh đẹp và bí ẩn, xuất hiện trong cuộc sống của Hoàng - một chàng trai hiện đại đang gặp khó khăn trong tình yêu và công việc. Linh không chỉ mang theo sự sáng tạo và niềm đam mê vào cuộc sống của Hoàng mà còn làm thay đổi hoàn toàn con người anh.\r\n\r\nQua từng khoảnh khắc ngọt ngào và xúc động, \"Cô Gái Đến Từ Hôm Qua\" đề cập đến những khía cạnh phức tạp của tình yêu và thời gian. Bộ phim không chỉ là một câu chuyện tình yêu đẹp đẽ mà còn là một tác phẩm triết lý về ý nghĩa của việc sống và yêu thương.\r\n\r\nVới diễn xuất xuất sắc của dàn diễn viên gồm Quỳnh Nga, Khương Ngọc, và Nhã Phương, \"Cô Gái Đến Từ Hôm Qua\" đã gây ấn tượng mạnh mẽ với khán giả bởi cốt truyện sâu sắc và hình ảnh đẹp mắt. Bộ phim không chỉ là một lựa chọn giải trí tuyệt vời mà còn là một bài học về ý nghĩa của cuộc sống và giá trị của thời gian.', '2024-04-14 10:32:33', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(10, 1, 'Gọi Giấc Mơ Về', '\"Gọi Giấc Mơ Về\" là một bộ phim tình cảm đậm chất hài hước của đạo diễn Việt Linh, ra mắt vào năm 2014, đã gây ấn tượng mạnh mẽ với khán giả bởi cốt truyện lôi cuốn và diễn xuất tài năng của các diễn viên.\r\n\r\nCâu chuyện xoay quanh cuộc sống của Hải - một chàng trai trẻ đầy hoài bão, luôn mơ về tình yêu và thành công trong sự nghiệp. Một ngày, anh tình cờ gặp được Ngọc - một cô gái tươi mới, lạc quan và đầy sức hút. Từ lúc gặp gỡ đầu tiên, hai người bắt đầu có những mối quan hệ gần gũi và phát triển tình cảm.\r\n\r\nTuy nhiên, họ phải đối mặt với nhiều khó khăn và thử thách trong cuộc sống, từ những hiểu lầm đến sự phản đối từ gia đình. Qua từng trở ngại, Hải và Ngọc cùng nhau vượt qua và hiểu ra ý nghĩa thực sự của tình yêu và sự hi sinh.\r\n\r\nVới sự tham gia của các diễn viên hàng đầu như Lê Bình, Quỳnh Nga, Trung Dân và Thái Hòa, \"Gọi Giấc Mơ Về\" đã tạo ra một bức tranh đầy màu sắc về tình yêu và hy vọng. Bộ phim không chỉ mang lại tiếng cười sảng khoái mà còn làm tan chảy trái tim của khán giả bằng thông điệp ý nghĩa về tình yêu và sự quý trọng cuộc sống.', '2024-04-14 10:33:21', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(11, 1, 'Em Là Bà Nội Của Anh', '\"Em Là Bà Nội Của Anh\" là một bộ phim tình cảm hài hước của đạo diễn Lê Văn Kiệt, ra mắt vào năm 2015, với sự tham gia của dàn diễn viên nổi tiếng như Jun Vũ, Khả Như, và Trấn Thành.\r\n\r\nCâu chuyện bắt đầu khi An - một cô gái trẻ vui vẻ và năng động, bất ngờ phải nhập viện vì tai nạn và mất trí nhớ. An tỉnh dậy và cho rằng mình là bà nội của Anh, một chàng trai trẻ và thành đạt, nhưng thật ra Anh chỉ là bác sĩ chăm sóc An tại bệnh viện. Từ đây, cuộc phiêu lưu và những tình huống hài hước bắt đầu diễn ra khi An và Anh cùng nhau trải qua những khoảnh khắc đầy bất ngờ và lãng mạn.\r\n\r\nBên cạnh yếu tố hài hước, bộ phim cũng chạm đến những tình cảm chân thành và ý nghĩa của gia đình, tình bạn và tình yêu. Qua từng tình tiết, \"Em Là Bà Nội Của Anh\" là một câu chuyện về sự hiểu biết, quan tâm và hy vọng trong cuộc sống.\r\n\r\nVới diễn xuất tự nhiên và đầy sức sống của các diễn viên, cùng với kịch bản hấp dẫn và hình ảnh đẹp mắt, bộ phim đã thu hút sự chú ý của đông đảo khán giả và nhận được nhiều lời khen ngợi từ giới phê bình. \"Em Là Bà Nội Của Anh\" không chỉ mang lại tiếng cười sảng khoái mà còn góp phần thắt chặt tình cảm và gắn kết trong mỗi gia đình.', '2024-04-14 10:34:54', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(12, 3, 'Doraemon: Nobita và bản giao hưởng địa cầu', 'Nobita đang tập chơi nhạc để chuẩn bị cho buổi hòa nhạc ở trường, môn mà cậu không giỏi. Một cô gái bí ẩn tên Mika xuất hiện và mời Nobita và những người bạn đến Đại Sảnh Danh Vọng Fare trên hành tinh nơi âm nhạc trở thành năng lượng. Để cứu Đại sảnh này, Mika cần tìm một bậc thầy âm nhạc biểu diễn cùng. Doraemon và bạn bè sử dụng \"Giấy phép Nhạc sĩ\" để chơi với Mika và khôi phục lại sảnh danh vọng. Tuy nhiên, một sinh vật đáng sợ muốn xóa bỏ âm nhạc khỏi thế giới, khiến trái đất gặp nguy hiểm. Liệu họ có thể cứu được “tương lai của âm nhạc” và trái đất? Đó là câu chuyện trong phim Doraemon: Nobita và bản giao hưởng Địa Cầu với sự tham gia của Wasabi Mizuta, Megumi Oohara, Yumi Kakazu và Kazuaki Imai.', '2024-04-20 17:14:33', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(13, 3, 'Pororo: Chim cánh cụt bé nhỏ (Phần 8)', 'Phim Pororo: Chim Cánh Cụt Bé Nhỏ (Phần 8) kể về chú chim cánh cụt Pororo và những người bạn trên hòn đảo nhỏ, bao gồm cáo Eddy, hải ly Loopy, gấu Bắc Cực Poby và khủng long Crong. Họ đã trải qua nhiều cuộc phiêu lưu thú vị và học được nhiều bài học quý giá trong cuộc sống.Đồng thời, qua những chuyến phiêu lưu đầy màu sắc, Pororo và bạn bè đã cùng nhau tạo ra những kỷ niệm đáng nhớ và học được ý nghĩa của tình bạn và sự đoàn kết.', '2024-04-20 17:22:14', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(14, 2, 'NCIS (Phần 11)', 'NCIS (Phần 11) là một bộ phim hành động, hình sự xoay quanh một nhóm đặc vụ điều tra các vụ án từ giết người, gián điệp cho đến khủng bố và cướp tàu ngầm. Đội ngũ này sẽ xác minh mọi vụ án có bất kỳ dấu vết nào liên quan đến nhân viên Hải quân và Thủy quân lục chiến, không phân biệt cấp bậc hay vị trí. Trong phim, các diễn viên chính gồm Sean Murray, Wilmer Valderrama và Katrina Law đã thể hiện sự xuất sắc trong việc tái hiện cuộc sống của các đặc vụ chuyên nghiệp. Với những tình tiết căng thẳng, gay cấn và những khám phá bất ngờ, NCIS (Phần 11) hứa hẹn mang lại cho khán giả những trải nghiệm đầy kịch tính và ly kỳ.', '2024-04-20 17:23:35', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(15, 2, 'Phim Thế giới ngầm Paris', 'Phim Thế giới ngầm Paris (Furies) của đạo diễn Mathieu Kassovitz kể về câu chuyện của một người phụ nữ trẻ tên là Fatima Adoum, do Marina Foïs thủ vai. Fatima quyết định trả thù cho cái chết của bố mình bằng cách infiltrate vào tổ chức tội phạm ngầm Fury ở Paris. Trong quá trình tiến hành nhiệm vụ, Fatima phải đối mặt với những khó khăn và nguy hiểm từ các thành viên trong tổ chức Fury. Cô phải thông minh, dũng cảm và quyết liệt để có thể hoàn thành sứ mệnh của mình. Tuy nhiên, khi đi sâu vào thế giới ngầm đen tối này, Fatima bắt đầu nhận ra rằng không phải ai cũng là như vẻ bề ngoài và cuộc sống của cô có thể rơi vào nguy hiểm lớn. Thế giới ngầm Paris (Furies) là câu chuyện xoay quanh về sự đấu tranh giữa cái ác và cái thiện, giữa lòng trung thành và lòng tham lam, mang lại cho khán giả những cảm xúc mãnh liệt và không dễ dàng lãng quên.', '2024-04-20 17:24:39', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(16, 2, 'Tương Tây Quỷ Sự', 'Trong làng ở phía tây Hồ Nam, hàng loạt sự việc kỳ lạ xảy ra khiến người dân hoang mang. Họ quyết định thuê ông Phong Thuỷ để giúp họ điều tra, nhưng không ngờ rằng ông lại rơi vào bẫy do ông Kim set up và buộc ông phải xuống lăng mộ. Không có người thân nào dẫn dắt, ông Phong Thuỷ cùng dân làng tham gia vào cuộc phiêu lưu khám phá lăng mộ đầy bí ẩn. Đó chính là nội dung của phim Tương Tây Quỷ Sự, với sự tham gia của các diễn viên Purba Rgyal, Wang Wanzhong, CLARA LEE và Li Liming.', '2024-04-20 17:25:32', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(17, 4, 'Cổng Thời Gian (Phần 1)', 'Cổng Thời Gian (Phần 1) là bộ phim xoay quanh câu chuyện của nữ thám tử Kiera Cameron, do Rachel Nichols thủ vai, đến từ tương lai năm 2077 và bị mắc kẹt ở quá khứ - năm 2012 tại Vancouver. Cô phát hiện ra rằng những tên tội phạm vô cùng độc ác đã du hành về quá khứ để thay đổi trật tự thế giới. Bên cạnh đó, còn có sự góp mặt của các nhân vật như Erik Knudsen và Victor Webster. Cuộc chiến gay gắt giữa Kiera và những tên tội phạm đã bắt đầu từ đây. Liệu Kiera có thể ngăn chặn âm mưu của chúng và trở về được với gia đình trong tương lai hay không? Mời bạn xem phim để khám phá câu trả lời cho những bí ẩn này!', '2024-04-20 17:26:27', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(18, 4, 'Xác Sống: Những Kẻ Còn Lại', 'Trong phim Xác Sống: Những Kẻ Còn Lại, câu chuyện tình yêu giữa Rick Grimes và Michonne bị thay đổi bởi một thế giới đã thay đổi. Họ bị tách biệt với nhau bởi khoảng cách và sức mạnh không thể ngăn chặn. Liệu họ có thể tìm thấy nhau và trở về với bản chất của mình trong hoàn cảnh khác biệt mà họ từng biết? Andrew Lincoln, Danai Gurira và Pollyanna McIntosh đã tái xuất trong bộ phim này, mang đến những tình tiết quan trọng và gây cấn.', '2024-04-20 17:27:44', 'data:image/jpeg;base64,'),
(19, 4, 'Tiệm Chụp Ảnh Ma Quái', 'Bộ phim \"Tiệm Chụp Ảnh Ma Quái\" (The Midnight Studio) kể về những câu chuyện đầy bí ẩn xung quanh một studio nhiếp ảnh chỉ chụp ảnh cho những linh hồn đã ra đi, do nhiếp ảnh gia Seo Ki Joo và các cộng sự đặc biệt của anh ta điều hành. Trong thế giới tăm tối và ma quái này, những bức ảnh được chụp tại studio này không chỉ là hình ảnh mà còn là cầu nối giữa thế giới sống và thế giới bên kia. Với sự tham gia của các diễn viên Joo Won, Kwon Na-ra, Yoo In-soo và đạo diễn Song Hyun-wook, \"Tiệm Chụp Ảnh Ma Quái\" hứa hẹn sẽ mang đến cho khán giả những trải nghiệm mới lạ và đầy kịch tính trong thể loại viễn tưởng khoa học. Đồng thời, thông qua câu chuyện về studio nhiếp ảnh đặc biệt này, bộ phim cũng gợi mở về những câu hỏi về cuộc sống và cái chết, về sự tồn tại của linh hồn sau khi rời bỏ cõi đời này.', '2024-04-20 17:28:42', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(20, 4, 'Spaceman', 'Trong phim Spaceman, phi hành gia cô đơn đã phải làm nhiệm vụ đơn độc trong sáu tháng. Trong quãng thời gian đó, anh đối mặt với những rạn nứt trong hôn nhân. May mắn thay, anh đã nhận được sự giúp đỡ từ một sinh vật bí ẩn mà anh phát hiện trên tàu của mình. Sự xuất hiện của sinh vật này đã giúp phi hành gia cô đơn tìm lại niềm tin và hy vọng trong cuộc sống.', '2024-04-20 17:29:22', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(21, 5, 'Cực Kỳ Kỳ Cục', 'Phim Cực Kỳ Kỳ Cục (Extremely Inappropriate!) kể về Ichiro, một giáo viên thể dục năm 1986 được học sinh sợ hãi bởi cách tiếp cận \"tình yêu khắc nghiệt\", lời nói cay đắng và hành vi thường xuyên \"không phù hợp\". Anh là một người cha đang cố gắng nuôi dạy một cô con gái nổi loạn sau khi đã mất vợ do bệnh tật. Khi anh bị truyền thời gian đến năm 2024, anh gặp phải những giá trị hiện đại giúp anh hiểu về lòng thông cảm nhưng cũng khiến cho mọi người ngày nay phải suy nghĩ lại về sự chính xác chính trị của mình trong bộ phim hài kịch xoay quanh sự thay đổi.', '2024-04-20 17:30:50', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(22, 5, 'Chim gõ kiến Woody đi trại hè', 'Phim \"Chim gõ kiến Woody đi trại hè\" là một bộ phim hoạt hình hài hước với sự tham gia của các diễn viên lồng tiếng nổi tiếng như Eric Bauza, Kevin Michael Richardson và Tom Kenny. Câu chuyện xoay quanh nhân vật chính là chim gõ kiến Woody, sau khi bị đuổi khỏi rừng, anh nghĩ rằng đã tìm được mái nhà cho quãng đời còn lại ở Trại Hè Woo Hoo. Tuy nhiên, cuộc sống yên bình của Woody tại trại hè lại bị đe dọa khi một thanh tra đe dọa đóng cửa trại. Để giữ lại mái nhà mới của mình, Woody phải tìm ra cách để ngăn chặn kế hoạch của thanh tra và giúp các bạn mới tại trại hè. Với sự tham gia của các diễn viên lồng tiếng hàng đầu và câu chuyện hấp dẫn, \"Chim gõ kiến Woody đi trại hè\" không chỉ mang lại những phút giây giải trí sảng khoái mà còn là bài học ý nghĩa về tình bạn và sự đoàn kết. Đây chắc chắn là bộ phim thú vị mà khán giả không nên bỏ lỡ!', '2024-04-20 17:31:34', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(23, 5, 'Ngược Dòng Thời Gian Để Yêu Anh (Phần 2)', 'Pudtarn, một cô gái trẻ xinh đẹp, đã bị cuốn vào một vụ tai nạn giao thông và bất ngờ được đưa về quá khứ. Cô nhận ra rằng cô không thể trở về nhà và phải học cách sống sót ở nơi mới này. Trong quá trình ấy, Pudtarn gặp Rit - một chàng trai lịch lãm và giàu có. Dù mọi người xung quanh nói rằng cô không xứng đáng với anh, nhưng tình yêu giữa họ dần dần nảy nở. Nhưng liệu tình yêu của họ có thể vượt qua mọi khó khăn và thử thách từ quá khứ hay không? Đó chính là câu chuyện đầy cảm xúc trong bộ phim \"Ngược Dòng Thời Gian Để Yêu Anh (Phần 2)\" do Thanavat Vatthanaputi, Ranee Campen và Warintorn Panhakarn thủ vai.', '2024-04-20 17:32:40', 'data:image/jpeg;base64,');

